// client/src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import AuthPage from './components/auth/AuthPage';
import AuthGuard from './components/auth/AuthGuard';
import ClubDashboard from './components/dashboard/ClubDashboard';
import CreateEventForm from './components/events/CreateEventForm';
import CreateCampaignForm from './components/campaigns/CreateCampaignForm';
import EventExpenseManager from './components/events/EventExpenseManager';
import { useAuth } from './store/app_store';
import { apiService } from './services/apiService';

function App() {
  const { isAuthenticated } = useAuth();

  // Mock handlers for forms - we'll replace these with real API calls soon
  const mockHandlers = {
    handleEventCreation: async (data: any) => {
      console.log('Event creation data:', data);
      // TODO: Replace with real API call using apiService.createEvent()
      alert('Event created! (Mock handler - will connect to API next)');
    },

    handleCampaignCreation: async (data: any) => {
      console.log('Campaign creation data:', data);
      // TODO: Replace with real API call using apiService.createCampaign()
      alert('Campaign created! (Mock handler - will connect to API next)');
    }
  };

  // Mock data for EventExpenseManager - matching Expense interface exactly
  const mockExpenses = [
    {
      id: '1',
      club_id: 'demo-club-1',
      event_id: 'demo-event-1',
      category: 'Venue',
      description: 'Hall rental',
      amount: 250,
      date: new Date('2024-06-15'),
      vendor: 'City Hall',
      payment_method: 'card' as const,
      status: 'approved' as const,
      created_by: 'demo-user-1',
      created_at: new Date('2024-06-15T10:00:00Z')
    },
    {
      id: '2',
      club_id: 'demo-club-1',
      event_id: 'demo-event-1',
      category: 'Food',
      description: 'Catering service',
      amount: 450,
      date: new Date('2024-06-15'),
      vendor: 'Local Catering Co.',
      payment_method: 'transfer' as const,
      status: 'pending' as const,
      created_by: 'demo-user-1',
      created_at: new Date('2024-06-15T11:00:00Z')
    }
  ];

  const mockExpenseHandlers = {
    handleAddExpense: async (expense: any) => {
      console.log('Adding expense:', expense);
      // TODO: Replace with real API call using apiService.addEventExpense()
      alert('Expense added! (Mock handler)');
    },
    handleUpdateExpense: async (id: string, expense: any) => {
      console.log('Updating expense:', id, expense);
      alert('Expense updated! (Mock handler)');
    },
    handleDeleteExpense: async (id: string) => {
      console.log('Deleting expense:', id);
      alert('Expense deleted! (Mock handler)');
    }
  };

  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Routes>
          {/* Public Route - Authentication */}
          <Route 
            path="/auth" 
            element={
              isAuthenticated ? (
                <Navigate to="/dashboard" replace />
              ) : (
                <AuthPage />
              )
            } 
          />

          {/* Protected Routes */}
          <Route 
            path="/dashboard" 
            element={
              <AuthGuard>
                <ClubDashboard />
              </AuthGuard>
            } 
          />

          <Route 
            path="/create-event" 
            element={
              <AuthGuard>
                <div className="p-8 max-w-4xl mx-auto">
                  <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
                    <h2 className="text-2xl font-bold text-gray-900 mb-6 text-center">
                      Create New Event
                    </h2>
                    <CreateEventForm 
                      onSubmit={mockHandlers.handleEventCreation}
                      onCancel={() => window.history.back()}
                    />
                  </div>
                </div>
              </AuthGuard>
            } 
          />

          <Route 
            path="/create-campaign" 
            element={
              <AuthGuard>
                <div className="p-8 max-w-4xl mx-auto">
                  <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
                    <h2 className="text-2xl font-bold text-gray-900 mb-6 text-center">
                      Create New Campaign
                    </h2>
                    <CreateCampaignForm 
                      onSubmit={mockHandlers.handleCampaignCreation}
                      onCancel={() => window.history.back()}
                    />
                  </div>
                </div>
              </AuthGuard>
            } 
          />

          <Route 
            path="/expense-manager" 
            element={
              <AuthGuard>
                <div className="p-8">
                  <div className="max-w-6xl mx-auto">
                    <h2 className="text-2xl font-bold text-gray-900 mb-6 text-center">
                      Event Expense Manager
                    </h2>
                    <EventExpenseManager 
                      eventId="demo-event-1"
                      eventTitle="Demo Quiz Night"
                      expenses={mockExpenses}
                      onAddExpense={mockExpenseHandlers.handleAddExpense}
                      onUpdateExpense={mockExpenseHandlers.handleUpdateExpense}
                      onDeleteExpense={mockExpenseHandlers.handleDeleteExpense}
                    />
                  </div>
                </div>
              </AuthGuard>
            } 
          />

          {/* Default redirects */}
          <Route 
            path="/" 
            element={
              isAuthenticated ? (
                <Navigate to="/dashboard" replace />
              ) : (
                <Navigate to="/auth" replace />
              )
            } 
          />

          {/* Catch all - redirect to appropriate page */}
          <Route 
            path="*" 
            element={
              isAuthenticated ? (
                <Navigate to="/dashboard" replace />
              ) : (
                <Navigate to="/auth" replace />
              )
            } 
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
